        mHdltvinHandle << " , " <<  " \"in_data_TVALID\" :  \"" << in_data_TVALID.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"in_data_TREADY\" :  \"" << in_data_TREADY.read() << "\" ";
